import React from "react";
import {Link} from "react-router-dom";
export const AddNewsletter = () => {
    const openCreate = ()=> {
        console.log("create");
        <Link to="/Newsletter"  className="nav-link active" aria-current="page" href="/">
          Send Newsletter
          </Link>
    }
  return (
    <>
      <div className="container mt-3 mb-3">
        <button className="btn btn-primary btn-xs me-3" onClick={ () => openCreate () }>
          <span className="icon is-small me-3">
            <i className="fa fa-plus"></i>
          </span>
          <span>Add newsletter</span>
        </button>
        <Link to="/Newsletter"  className="btn btn-primary btn-xs" aria-current="page" href="/">
        <span className="icon is-small me-3">
            <i className="fa fa-plus"></i>
          </span>
          <span>Add newsletter Link</span>
          </Link>
      </div>
    </>
  );
};
